-- Table structure for `monsters`
CREATE TABLE `monsters` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(45) DEFAULT NULL,
  `level` int(11) DEFAULT 0,
  `hp` int(11) DEFAULT 0,
  `attack` int(11) DEFAULT 0,
  `speed` int(11) DEFAULT 0,
  `on_death_exp` int(11) DEFAULT 0,
  `on_death_gold` int(11) DEFAULT 0,
  `defence` int(11) DEFAULT 0,
  `crit_chance` int(11) DEFAULT 0,
  `crit_multi` int(11) DEFAULT 0,
  `life_steal` int(11) DEFAULT 0,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=281 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

